import axios from "axios"
import React,{ useEffect, useState } from "react";
import './static/Projects.css'

const Projects = (props)=>{
    const [Data,SetData] = useState([]);
    async function fetchProduct(){
        const response = await axios.get("http://localhost:5000/view/view_product");
        SetData(response.data)
    }
    useEffect(()=>{
        fetchProduct()
    },[])
    const Filterer = (cat,pdt)=>{
        return pdt.category === cat
    }

    const Projects =(cat)=> {Data.filter((item)=>Filterer(cat,item))}
    return(
        <>
        <ul>
            {props.Categories.map((cat)=>(
                <li key={cat._id}>
                    {cat.category}
                </li>))}
        </ul>
        <table>
            <tr>
                <th>Title</th><th>Category</th><th>Sub Category</th><th>View</th>
            </tr>
            {props.Categories.map((categ)=>(
                Data.map((project)=>(<tbody>
                    
            <tr key={project._id}>
            <td>{project.title}</td>
            <td>{project.category}</td>
            <td>{project.sub_category}</td>
            <td>View</td>
            </tr>
            </tbody>))))}
        </table>
        </>
    )
}
export default Projects;
